column13:
A non-liquid, liquid, liquid-gel or gelled fabric care composition and method of use comprising: 

(a) one or more fabric care enzymes, the fabric care enzymes effective for aiding in preventing pilling fuzzing, staining and other deterioration of fabric fibers during the wash process; 

(b) one or more UV protectants, the one or more UV protectants for brightening and preventing light caused photo fading or other damage to fabrics; 

(c) one or more surface active dispersing, emulsifying and/or solubilizing agent, the one or more surface active dispersing, emulsifying and/or solubilizing agent principally comprised of surfactants, co-surfactants, hydrotropes and solvents selected to solubilize or stabilize the composition; 

(d) one or more dye-transfer inhibitors, anti-redeposition agents or dye sequestrants, the one or more dye-transfer inhibitors, anti-redeposition agents or dye sequestrants to prevent re-deposition of dyes which have become transient from other fabrics; 

(e) one or more dye, pigment and fabric color fixative or finish protectant, the dye, pigment and fabric color fixative or finish protectant to lock-in dyes and pigments to prevent their loss in quantity or quality during soaking or washing; 

(f) optionally, one or more textile lubricant and/or textile softening agent, the lubricant and/or textile softening agent to coat the textiles and reduce inter-fiber and fiber surface friction; 

(g) one or more hardness and metal ion sequestrants and crystal growth inhibitors, the hardness and metal ion sequestrants and crystal growth inhibitors to bind free ions to prevent formation of insoluble precipitate compounds; 

(h) one or more chlorine and/or active oxygen scavengers or neutralizers which act to neutralize oxidizing agents, i.e., those species with oxidation potential; and 

(i) optionally, one or more from the following: handling, storage, processing agents to modify elastic and viscous phase properties, anti-foaming or frothing agents, anti-microbial, anti-bacterial or anti-fungal agents, pH buffer, adjustment, aesthetic dyes and/or fragrances.
